measurements.description:
Four flowers on two up to 15.2-cm supported inflorescences;
 sepals lanceolate, pale lavender;
 petals ovate, pale lavender overlaid dark purple distally;
 lip oval, cleft, slightly ruffled, pale lavender overlaid dark purple distally and center stripe, throat white;
 column white blushed pale lavender, anther cap dark purple; 
substance medium-firm; texture matte.
